uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- ASSETS ---
uniform sampler2D iChannel0; // Noise Texture (Optional)
uniform sampler2D iChannel1; // Not used but reserved

// --- STANDARD CONTROLS ---
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;

// --- VISUAL CONTROLS ---
uniform float u_voxel_scale;
uniform float u_plasma_density;
uniform float u_color_saturation;
uniform float u_tunnel_radius;

out vec4 fragColor;

// --- LUMINA MATH LIB ---
#define PI 3.14159265359

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Hyperbolic Tangent (Visual Saturation)
vec3 tanh_approx(vec3 x) {
    vec3 x2 = x * x;
    return clamp(x * (27.0 + x2) / (27.0 + 9.0 * x2), -1.0, 1.0);
}

// --- CORE FUNCTIONS (Ported from Reference) ---

// Tunnel SDF for Voxel Density
float tunnel(vec3 p, float r) {
    p = abs(p);
    return min(r - p.x, r - p.y);
}

// Procedural Pattern Generation (Originally 'tex')
vec3 getProceduralPattern(vec3 ro, vec3 rd, vec3 p, vec3 n) {
    vec3 rgb = vec3(0.0);

    // Ray-Plane Intersection for texture mapping
    // Solve: dot(n, ro + t*rd - p) = 0
    float t = dot(n, p - ro) / dot(n, normalize(rd));
    vec3 hit = ro + normalize(rd) * t;

    // Procedural "Circuit" Pattern
    float pattern = dot(cos(iTime + hit * 4.0) * 0.1 + sin(iTime + hit * 0.1), vec3(0.1));
    rgb = mix(rgb, abs(vec3(1.0, 2.0, 10.0) / pattern), 0.01);

    return rgb;
}

// Voxel Marching Algorithm (DDA)
// Returns: vec4(hitPosition, stepsTaken)
// Out: side (0=x, 1=y, 2=z)
vec4 marchVoxels(vec3 ro, vec3 rd, float maxSteps, float minS, out int side, float radius) {
    vec3 p = floor(ro);
    vec3 rSign = sign(rd);
    vec3 deltaDist = 1.0 / abs(rd);
    vec3 sideDist = (rSign * (p - ro) + (rSign * 0.5) + 0.5) * deltaDist;

    float s = 0.0;
    float i = 0.0;

    for (i = 0.0; i < maxSteps; i++) {
        // DDA Step
        if (sideDist.x <= sideDist.y && sideDist.x <= sideDist.z) {
            sideDist.x += deltaDist.x;
            p.x += rSign.x;
            side = 0;
        } else if (sideDist.y <= sideDist.z && sideDist.y <= sideDist.x) {
            sideDist.y += deltaDist.y;
            p.y += rSign.y;
            side = 1;
        } else {
            sideDist.z += deltaDist.z;
            p.z += rSign.z;
            side = 2;
        }

        // Sample Tunnel Distance
        s = tunnel(p * u_voxel_scale, radius);
        if (s < minS) break;
    }

    return vec4(p, i);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // --- SETUP ANIMATION VARS ---
    float T = (sin(iTime * 0.3) * 2.0) + iTime * u_speed;

    // Camera Shake / Sway
    uv += vec2(sin(T * 0.4) * 0.1, sin(T * 0.3) * 0.1) * u_camera_dist;

    // --- RAY SETUP ---
    // Camera Position (Flying forward)
    vec3 ro = vec3(0.0, 0.0, T * 20.0) / u_voxel_scale;

    // Ray Direction (Warped)
    vec3 rd = normalize(vec3(uv, u_fov));

    // Apply Rotation/Camera movement effects
    float rotAngle = tanh(sin(ro.z * 0.005) * 4.0) * 3.0;
    mat2 rotMat = rot(rotAngle);
    rd.xy *= rotMat;
    rd.xy *= rot(sin(T * 0.3) * 0.2); // Gentle sway

    // DDA Setup
    int side = 0;
    vec3 n = vec3(0.0);
    vec3 col = vec3(0.0);

    // --- PASS 1: STRUCTURE MARCH ---
    // Marches through the grid to find the walls
    vec4 vox = marchVoxels(ro, rd, 150.0, 0.01, side, 16.0 * u_tunnel_radius);

    // Determine Normal
    n = vec3(side==0, side==1, side==2);

    // Hit Position in Voxel Space
    vec3 p = vox.xyz + 0.5 - sign(rd) * 0.5;

    // Structural Lighting (Square Lights)
    vec3 lights = 0.3 * abs(sin(p) / dot(sin(0.2 * T + p), vec3(5.0)));

    // Add Procedural Texture to Structure
    col += 0.3 * getProceduralPattern(ro, rd, p, n);

    // --- PASS 2: PLASMA / VOLUMETRIC MARCH ---
    // Start slightly offset to avoid self-intersection
    vec3 p2 = ro * 0.95; 

    // We run a second march with different parameters to find "inner" volumes or lights
    vec4 vox2 = marchVoxels(p2, rd, 150.0, 0.01, side, 24.0 * u_tunnel_radius);
    vec3 n2 = vec3(side==0, side==1, side==2);
    vec3 pHit2 = vox2.xyz + 0.5 - sign(rd) * 0.5;

    // Define Palettes
    vec3 blue = vec3(0.15, 0.11, 0.57) * 1.5;
    vec3 red = vec3(0.7, 0.11, 0.05) * 2.5;

    // Add Red Glow from inner march
    col += 4.0 * red * getProceduralPattern(ro, rd, pHit2, n2) * u_glow_intensity;

    // Plasma/Liquid Light Calculation
    lights += abs(blue * sin(pHit2.yzx) / dot(sin(0.3 * T + pHit2.xyz), vec3(10.0 / u_plasma_density)));

    // Combine Lights
    col += lights * u_glow_intensity;

    // --- POST PROCESS ---
    // Inverse distance fog (Volumetric Fade)
    // Formula: tanh( 7 * col / steps * exp(steps/45) )
    // This gives that specific "blown out" neon look
    float fog = exp(vox.w / 45.0);
    vec3 finalCol = 7.0 * col / vox.w * fog;

    // Saturation / Toning
    finalCol = tanh_approx(finalCol * u_color_saturation);

    fragColor = vec4(finalCol, 1.0);
}

